import axios from 'axios';

let data = axios.post('http://test1.hokhang.com/hksCloudService/getEventService.php?appId=119871&dataGroupCode=01&primaryCategory=&secondarCategory=&index=0&limit=30&lat=25.000000&lon=121.000000'
	)
	.then(function (response) {
		console.log(JSON.parse(response));
	})
	.catch(function (error) {
		console.log(error);
	});

export default data;
